import React from "react";
import styled from "styled-components";


class NavbarMovie extends React.Component{
    render(){
     // <div style={{ width:"100%", height: 70, background: "red", display: "flex", justifyContent: "space-between" }}></div> Inline style example
     // In file css
        return (
            <>
               <Nav>
                <div style={styles.title}>
                    Title
                </div>
                <div style={styles.cartContiner}>
                    <img alt="Cart Icon" src = "https://cdn-icons-png.flaticon.com/128/891/891462.png" style={styles.cartIcon}/>
                    <span style={styles.cartCount}>0</span>
                </div>
                </Nav>
            </>
        )
    }
}

export default NavbarMovie;


// Inine styling
const styles = {
  cartIcon: {
    height: 48,
    marginRight: 20,
  },
  nav: {
    height: 70,
    background: "#4267b2",
    display: "flex",
    justifyContent: "space-between" ,
    alignItems: "center",
    position: "relative",
  },
  title:{
    fontSize: 30,
    color: "#fff",
    fontWeight: 600,
    fontFamily: '"Montserrat", sans-serif',
    textTransform: "uppercase",
    marginLeft: 20
  },
  
  cartIconContainer: {
    position: "relative",
    cursor: "pointer",
  },
  cartCount: {
    background: "orange",
    borderRadius: "50%",
    padding: "4px 8px",
    position: "absolute",
    right: 10,
    top: -5,
    fontSize: 12,
  },
}; 


// styled Components

const Nav = styled.div`
width: 100%;
height: 50px;
background-color: cyan;
display: flex;
justify-content: space-between;
`

const Title = styled.div``
